import { HttpErrorResponse } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { ComplicationCrisesDouleureuse } from 'src/app/models/ComplicationCrisesDouleureuse';
import { CriseService } from 'src/app/services/crise.service';

@Component({
  selector: 'app-updatecrise',
  templateUrl: './updatecrise.component.html',
  styleUrls: ['./updatecrise.component.css']
})
export class UpdatecriseComponent implements OnInit {
  crises: any[] = [];
  errorMessage: string = '';

  constructor(
    private criseService: CriseService,
    private router: Router,
    private route: ActivatedRoute
  ) {}

  ngOnInit(): void {
    this.route.paramMap.subscribe(params => {
      const PatientID = params.get('PatientID');
      if (PatientID) {
        const id = parseInt(PatientID, 10);
        if (!isNaN(id)) {
          this.getById(id);
        } else {
          console.error('Invalid patient ID:', PatientID);
        }
      } else {
        console.error('Patient ID is missing in route');
      }
    });
  }

  private getById(PatientID: number) {
    this.criseService.getById(PatientID).subscribe(
      (data: any) => {
        // Ensure data is an array
        if (Array.isArray(data)) {
          this.crises = data;
        } else {
          this.crises = [data]; // Convert to array if single object is returned
        }
        console.log('Formatted data:', this.crises);
      },
      (error: HttpErrorResponse) => {
        this.errorMessage = error.message;
        console.error('Error fetching complication data:', error);
      }
    );
  }

  onSubmit() {
    const patientID = parseInt(this.route.snapshot.paramMap.get('PatientID')!, 10);
    if (!isNaN(patientID)) {
      this.criseService.update(patientID, this.crises).subscribe(
        response => {
          console.log('Update successful', response);
          this.router.navigate(['/']); // Adjust this to your desired route after successful update
        },
        (error: HttpErrorResponse) => {
          this.errorMessage = error.message;
          console.error('Error updating complication data:', error);
        }
      );
    } else {
      console.error('Invalid patient ID:', patientID);
    }
  }

  addCriseForm() {
    this.crises.push({});
  }
}
